import React from "react";
import "./headerHome.modul.css";

export default function HeaderHome() {
  return (
    <div className="headerHome w-100 t-0 position-fixed d-flex justify-content-between align-items-center">
      <a href="" className="logo d-flex flex-nowrap">
        <ion-icon name="dice-outline"></ion-icon>
        <div className="logo__text">DashBoard</div>
      </a>

      
    </div>
  );
}
